// KMP
class Solution {
    public:
        int strStr(char *str, char *pattern) {
            if(!pattern || pattern[0] == '\0') {
                return 0;
            }
            if(!str) {
                return -1;
            }

            int slen = -1, plen = -1;
            while(str[++slen] != '\0') {} //empty while
            while(pattern[++plen] != '\0') { } //empty while
            if(slen < plen) {
                return -1;
            }

            int *next = new int[plen](); //value initialization
            initPartialMatchTable(pattern, plen, next);

            //find match
            for(int i=0; i<=slen-plen;) {
                if(str[i] != pattern[0]) {
                    ++i;
                    continue;
                }
                int j = 1;
                for(; j<plen; ++j) {
                    if(str[i+j] != pattern[j]) {
                        i += j - next[j-1];
                        break;
                    }
                }
                if(j == plen) {
                    delete next;
                    return i;
                }
            }

            delete next;
            return -1;
        }

    private:
        // construct partial match table
        //void initPartialMatchTable(char *pattern, int len, int *next) {
        //    for(int i=1; i<len; ++i) {
        //        next[i] = calcPartialMatchLength(pattern, i);
        //    }
        //}

        //int calcPartialMatchLength(char *pattern, int index) {
        //    int len = index;
        //    while(len>0) {
        //        if(equal(pattern, pattern+len, pattern+index-len+1)) {
        //            return len;
        //        } else {
        //            --len;
        //        }
        //    }

        //    return 0;
        //}

        // more fast, use known next[i-1] to calculate next[i]
        void initPartialMatchTable(char *pattern, int len, int *next) {
            for(int i=1; i<len; ++i) {
                int mlen = next[i-1]; // match length
                while(mlen>=1 && pattern[i] != pattern[mlen]) {
                    mlen = next[mlen-1];
                }
                if(pattern[i] == pattern[mlen]) {
                    next[i] = mlen + 1;
                } else {
                    next[i] = 0;
                }
            }
        }
};

int main(int argc, char const* argv[]) {
    Solution s;
    const char *str = "abcbcd";
    const char *pattern = "bc";
    cout << "1 == " << s.strStr(const_cast<char *>(str),
            const_cast<char *>(pattern)) << endl;

    str = "mississippi";
    pattern = "issip";
    cout << "4 == " << s.strStr(const_cast<char *>(str),
            const_cast<char *>(pattern)) << endl;

    str = "abbabaaaabbbaabaabaabbbaaabaaaaaabbbabbaabbabaabbabaaaaababbabbaaaaabbbbaaabbaaabbbbabbbbaaabbaaaaababbaababbabaaabaabbbbbbbaabaabaabbbbababbbababbaaababbbabaabbaaabbbba";
    pattern = "bbbbbbaa";
    cout << "118 == " << s.strStr(const_cast<char *>(str),
            const_cast<char *>(pattern)) << endl;

    //length 32316
    str = "";
    pattern = "";
    cout << "-1 == " << s.strStr(const_cast<char *>(str),
            const_cast<char *>(pattern)) << endl;

    return 0;
}
